.nav {
  width: 100%;
  max-width: 1280px;
  height: 4rem;
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin: 0 auto;

  &__logo {
    @include media(tablet) {
      font-size: 1.5rem;
    }
  }
  &__list {
    font-family: 'Roboto Mono', monospace;
    display: flex;
    align-items: center;
    @include media(tablet) {
      display: none;
    }
    &-element {
      margin-right: 3rem;
    }
  }
  .is-open &__list {
    display: flex;
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100vh;
    justify-content: space-evenly;
    flex-direction: column;
    align-items: center;
    background-color: #fff;
    z-index: 3;
  }
  &__burger {
    position: relative;
    display: none;
    background-color: transparent;
    border: none;
    width: 2.5rem;
    height: 3rem;
    overflow: hidden;
    cursor: pointer;
    z-index: 4;
    @include media(tablet) {
      display: block;
      margin-right: 3rem;
    }
    &-element {
      position: relative;
      flex: none;
      width: 100%;
      height: 2px;
      background: #000;
      display: flex;
      align-items: center;
      justify-content: center;
      &::before,
      &::after {
        content: '';
        position: absolute;
        z-index: 1;
        top: -8px;
        width: 100%;
        height: 2px;
        background: inherit;
      }
      &::after {
        top: 8px;
        transform: translateX(50%);
      }
      &::before {
        transform: translateX(-50%);
      }
    }
  }
}

