sources.src/scss/_project.scss:
.project {
  position: relative;
  display: flex;
  flex-direction: column;
  width: 300px;
  height: 15rem;
  border: 1px solid #e7e7e7;
  padding: 0.5em 1em;
  margin-top: 2em;
  margin-right: 0.7em;
  @include media(tablet) {
    margin-right: 0;
  }
  &__heading {
    display: flex;
    justify-content: flex-start;
    align-items: center;
  }
  &__description {
    margin-top: 0.8rem;
    line-height: 1.2rem;
  }
  &__links {
    display: flex;
    position: absolute;
    bottom: 18%;
  }
  &__link {
    margin-top: 0.8rem;
    display: flex;
    align-items: center;
    &:not(:nth-child(2)) {
      margin-right: 20px;
    }
  }
  &__stack {
    width: 100%;
    position: absolute;
    bottom: 5%;
    left: 8%;

    &-html,
    &-scss,
    &-js,
    &-react,
    &-css {
      position: relative;
      margin-right: 2em;
    }
    &-html::before,
    &-scss::before,
    &-css::before,
    &-js::before,
    &-react::before {
      content: '';
      width: 10px;
      height: 10px;
      position: absolute;
      top: 50%;
      left: -15px;
      transform: translateY(-50%);
      border-radius: 100%;
      z-index: 2;
    }
    &-html::before {
      background-color: #e34c26;
    }
    &-scss::before {
      background-color: #c6538c;
    }
    &-css::before {
      background-color: #563d7c;
    }
    &-js::before {
      background-color: #f1e05a;
    }
    &-react::before {
      background-color: #61dbfb;
    }
  }
  &__more {
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    border-color: transparent;
    @include media(tablet) {
      margin-top: 0;
    }
    &-link {
      display: flex;
      align-items: flex-end;
      margin-top: 1em;
      border: 1px solid #000;
      padding: 0.5rem 2.3rem;
      border-radius: 10px;
    }
  }

  &.aron {
    justify-content: space-evenly;
    align-items: center;
  }
  .aron-photo {
    border-radius: 100%;
    flex: none;
  }
}

